import React from 'react';
import ReactDOM from 'react-dom';
import ListItems from './list_items.js';

class Navbar extends React.Component {
  render() {
    return(
      <nav className="navbar navbar-expand-xl">
        <ListItems/>
      </nav>
    )

  }
}

export default Navbar;
